import React, { Component } from 'react';
import { Link, withRouter } from "react-router-dom"
import {connect} from 'react-redux'
import { Button, Grid, Header, Label } from "semantic-ui-react"


class Nav extends Component {

  handleLogout = e => {
    localStorage.clear()
    this.props.logoutUser()
    this.props.history.push("/login")
  }

  render() {
    console.log(this.props)
    return ( 
      <div className='nav-bar'>
        <Button as={Link} to='/profile/1' >Prof</Button>
        <Button as={Link} to='/feed' >Feed</Button>
        <Button as={Link} to='/newsong' >Upload Song</Button>
        <Button as={Link} onClick={this.props.handleLogout}>Logout</Button>
      </div>
     );
  }
}

const mapStateToProps = state => {
  return {
    user: state.user
  }
}

export default connect(
  mapStateToProps,
  // null,
  {logoutUser}
)(withRouter(Nav))
